import React, { Component } from 'react';
import { render } from "react-dom";
import { Chrono } from "react-chrono";
import { ThemeConsumer } from 'styled-components';

const items = [
    {
        title: "Apr 2021",
      },
      {
        title: "Jan 2021",
      },
      {
        title: "Nov 2020",
      },
];

class NewTimeline extends Component {
    render() {
        return (
            <div style={{ width: "100%", height: "100%" }}>
            <Chrono
              items={items}
              mode="VERTICAL_ALTERNATING"
              hideControls="true"
              theme={{primary: "#cdcdcd", secondary: "none", cardBgColor: "#00011c", cardForeColor: "#cdcdcd" }} 
              >
            <p className="p2">
                <h3>AfterClass Intern</h3>
                Coming soon, while we work on it after class
            </p>
            <div className="p2">

                <h3>SMU Business Intelligence and Analytics Data Associate</h3>
                <br></br>
                <p>Utilised machine learning models to develop a coding language classifier</p>
            </div>
            <p className="p2">
                <strong>Ellipsis Marketing</strong>
                <br></br><br></br>
                Designed marketing collaterals, electronic direct mails and social media posts for Ellipsis-related campaigns and events
            </p>
            </Chrono>
          </div>
        );
    }
}

export default NewTimeline;
